    "contracts/rates/ksETH/woETHRateProvider.sol": {
      "content": "pragma solidity ^0.8.0;\n\ninterface IwoETH {\n    function convertToAssets(uint256 _shares) external view returns (uint256);\n}\n\ncontract woETHRateProvider {\n    address public immutable woETH = 0xDcEe70654261AF21C44c093C300eD3Bb97b78192;\n    uint256 public immutable startingRate;\n    uint256 public immutable ksETHPerToken;\n    uint256 public immutable tokenPerksETH;\n\n    constructor() {\n        startingRate = 1.0945 ether;\n        ksETHPerToken = startingRate;\n        tokenPerksETH = 1e18 * 1e18 / startingRate;\n    }\n\n    function accrualRate() public view returns (uint256) {\n        return 1e18 * _underlyingRate() / startingRate;\n    }\n\n    function _underlyingRate() internal view returns (uint256) {\n        return IwoETH(woETH).convertToAssets(1 ether);\n    }\n}"
